import React, {Component,  useState} from "react";
import './Navbar.css';
import Highlighter from "react-highlight-words";
import 'bootstrap/dist/css/bootstrap.min.css';
import classnames from 'classnames';
import {
    Table,Col, TabContent, Pagination, PaginationItem, PaginationLink, Form, FormGroup, Label, Input , TabPane, Nav, NavItem, NavLink, Card, Button, CardTitle, CardText, Row
     } from 'reactstrap';
export class Search extends Component {
    constructor(props) {
        super(props);
        const [activeTab, setActiveTab] = useState('1');

        const toggle = tab => {
            if(activeTab !== tab) setActiveTab(tab);
        }

        this.state = {
            politicians : [],
            states : [],
            bills : []

        }
    }

    
    componentDidMount(){
        this.loadData();
    }

    
    loadData(){
        var total = 300;
        for(var i = 0; i < total; i++){
            fetch('https://api.empoweringknowledge.me/api/bills'+ "?page=" + i)
            .then(res => res.json())
            .then((data) => {
                total = data.total_pages
                this.setState({ bills: data.objects});      
            })
            .catch(console.log)
        }
        for(var i = 0; i < total; i++){
            fetch('https://api.empoweringknowledge.me/api/congressmembers'+ "?page=" + i)
            .then(res => res.json())
            .then((data) => {
                total = data.total_pages
                this.setState({ politicians: data.objects});      
            })
            .catch(console.log)
        }
        for(var i = 0; i < total; i++){
            fetch('https://api.empoweringknowledge.me/api/states'+ "?page=" + i)
            .then(res => res.json())
            .then((data) => {
                total = data.total_pages
                this.setState({ states: data.objects});      
            })
            .catch(console.log)
        }
    }


    render(){
        const [activeTab, setActiveTab] = useState('1');

        const toggle = tab => {
            if(activeTab !== tab) setActiveTab(tab);
        }


      
        return(
            <div>
            <Nav tabs>
              <NavItem>
                <NavLink
                  className={classnames({ active: activeTab === '1' })}
                  onClick={() => { toggle('1'); }}
                >
                  Bills
                </NavLink>
              </NavItem>
              <NavItem>
                <NavLink
                  className={classnames({ active: activeTab === '2' })}
                  onClick={() => { toggle('2'); }}
                >
                  Politicians
                </NavLink>
              </NavItem>
            </Nav>
            <TabContent activeTab={activeTab}>
              <TabPane tabId="1">
                <Row>
                  <Col sm="12">
                  <Table hover responsive>
                    <thead>
                    <tr>
                        <th>#</th>
                        <th>Title</th>
                        <th>Sponsor</th>
                        <th>Committees</th>
                        <th>Introduced Date</th>
                        <th>House Passage</th>
                        <th>Senate Passage</th>
                        <th>Democrat Cosponsors</th>
                        <th>Republican Cosponsors</th>
                    </tr>
                    </thead>
                    <tbody>
                        
                    {this.getBillResults().map(item =>
                        <tr>
                            {item}
                        </tr>
                    )}
                    </tbody>
                    </Table>
                  </Col>
                </Row>
              </TabPane>
              <TabPane tabId="2">
                <Row>
                  <Col sm="6">
                    <Card body>
                      <CardTitle>Special Title Treatment</CardTitle>
                      <CardText>With supporting text below as a natural lead-in to additional content.</CardText>
                      <Button>Go somewhere</Button>
                    </Card>
                  </Col>
                  <Col sm="6">
                    <Card body>
                      <CardTitle>Special Title Treatment</CardTitle>
                      <CardText>With supporting text below as a natural lead-in to additional content.</CardText>
                      <Button>Go somewhere</Button>
                    </Card>
                  </Col>
                </Row>
              </TabPane>
            </TabContent>
          </div>
        )
    }
}
export default Search;
